Patch Set 2:

> Patch Set 2:
> 
> interface-output doesn't get called for tunnel interfaces like GRE, IPIP, IPSec, etc. Which tunnel type do you see this problem with?

geneve. Here is the buffer trajectory dump at virtio-output when it is about to add the same buffer to the pcap trace buffer.

@4000000060de5be119189944 ethernet-input (410)
@4000000060de5be119189d2c ip4-input (345)
@4000000060de5be11918a114 ip4-lookup (360)
@4000000060de5be11918a4fc ip4-rewrite (356)
@4000000060de5be11918a8e4 ip4-sv-reassembly-output-feature (331)
@4000000060de5be11918accc pnat-output (1)
@4000000060de5be1191954c4 interface-output (419)
@4000000060de5be1191958ac virtio-0/0/4/0-output (437)

Patch Set 4:

> Patch Set 4:
> 
> > Patch Set 4:
> > 
> > > Patch Set 4:
> > > 
> > > the virtio output is not from the geneve tunnel. it looks like pnat has changed the output interface from the virtio to the ethernet. i would have tought it would be preferable for the pcap trace to have the ethernet interface, since that is the interface on which the packet ultimately left the system.
> > > this case might be better fixed by running interface output features before the pcap trace.
> > 
> > In Geneve where Ethernet is the payload, I believe geneve decap recycles packet back to ethernet-input. PNAT does not change any interfaces. It only rewrites VNI/SA/DA.
> 
> sorry, i read the trace wrong.
> if that is the trace from the re-inject from geneve decap, where's the first pcap trace happening?

@4000000060de5be119189944 ethernet-input (410)
@4000000060de5be119189d2c ip4-input (345)
@4000000060de5be11918a114 ip4-lookup (360)
@4000000060de5be11918a4fc ip4-rewrite (356)
@4000000060de5be11918a8e4 ip4-sv-reassembly-output-feature (331)
@4000000060de5be11918accc pnat-output (1)
@4000000060de5be1191954c4 interface-output (419)
@4000000060de5be1191958ac virtio-0/0/4/0-output (437)

The pcap trace that I included before, as above again, started from a device driver,
say memif-input. It goes through ethernet-input. It is then routed via ip4. Both
ip4-sv-reassembly-output-feature and pnat-output are feature arcd of ip4-input.

Notice geneve.c calls this
      vnet_set_interface_output_node (vnm, hw_if_index, encap_index);
to add vnet_per_buffer_interface_output_node as the next_node when the tunnel is created.

Continute from ip4-sv-reassembly-output-featuree, pnat-output now enqueues the packet to
the next node which hits this code to add the first trace entry

VLIB_NODE_FN (vnet_per_buffer_interface_output_node) (vlib_main_t * vm,
						      vlib_node_runtime_t *
						      node,
						      vlib_frame_t * frame)
{
  vnet_main_t *vnm = vnet_get_main ();
  u32 n_left_to_next, *from, *to_next;
  u32 n_left_from, next_index;

  vnet_interface_pcap_tx_trace (vm, node, frame,
				1 /* sw_if_index_from_buffer */ );
...				
}

The second trace entry is added via interface-output node when it hits this code.

VLIB_NODE_FN (vnet_interface_output_node)
(vlib_main_t *vm, vlib_node_runtime_t *node, vlib_frame_t *frame)
{
...
  vnet_interface_pcap_tx_trace (vm, node, frame,
				0 /* sw_if_index_from_buffer */ );
...
}

By the way, I tried your suggestion to move the pcap call at the end of interface-output,
it still creates 2 trace entries for "pcap trace rx tx intfc virtio-0/0/4/0"
